import './lib/tailwind/output.css';
import NavBar from './components/NavBar';


function App() {
  return (
    <div className='min-h-screen text-white bg-blue-logo'>
      
      <NavBar/>
    
        <div className='curve'></div>
    </div>
  );
}

export default App;
